 import Lottie from 'lottie-react'
 import Globe from '../animations/Globe.json'
 function Contact(){
  return(
    <div className=''>
      <h1>Contact us here</h1>
      <Lottie animationData={Globe} width={20} height={20} style={{height: "500px", width: "auto", overflow: "auto"}}

      onAnimationEnd={"end"}/>
    </div>
  )
}

export default Contact
